import React from 'react';
import IconModal from "../../UI/IconModal";

const Menu = props => (
    <IconModal viewBox="0 0 23 20" {...props}>
        <path d="M2 2H21" stroke="white" strokeWidth="4" strokeLinecap="round"/>
        <path d="M2 10H21" stroke="white" strokeWidth="4" strokeLinecap="round"/>
        <path d="M2 18H21" stroke="white" strokeWidth="4" strokeLinecap="round"/>
    </IconModal>
);

export default Menu;
